import React from "react";
import "./App.css";
import Welcome from "../src/com/fplan/components/welcome";
import ContainedButtons from "./com/fplan/components/ui/ContainedButttons";

function App() {
  return (
    <div className="App">
      <Welcome></Welcome>
      <ContainedButtons></ContainedButtons>
    </div>
  );
}

export default App;
